import '../css/VideoPlayer.css';
import React from 'react';

const VideoPlayer = (props) => {
  return (
    <div id="video-player-wrapper">
      <div id="video-player">
          <video src={`${props.player}`} controls loop/>
        <video preload="auto" controls/>
      </div>
    </div>
  );
};

export default VideoPlayer;
